import Link from 'next/link';

const Menu = ({ items }) => {

  return (

    <>
      <div className="row all">
        <div className="col">

          <ul>
            {items.map(item => (

              <li>
                <Link href="{item.link}">{item.text}</Link>

                <div hidden="{!item.sub}" className="bg"></div>

                <ol hidden="{!item.sub}">

                  {item.sub.map(sub => (
                    <li><Link href="{sub.link}">{sub.text}</Link></li>
                  ))}

                </ol>

              </li>

            ))}
          </ul>

        </div>
      </div>

    </>
  )
}


export default Menu;
